import React, { useState, useEffect } from 'react'
import Users from './Users';
import './style.css'
import { useLocation } from 'react-router-dom';
import Navbar from '../user_component/usernavbar';


function UserForm() {
    const location = useLocation()
    const user = location.state
    console.log(user)
    const [userdata, setUserdata] = useState([]);
    const getUserdata = async () => {
        try {
            const req = await fetch("http://localhost:3001/users");
            const resData = await req.json();
            if (resData.length > 0) {
                setUserdata(resData);
            }
        } catch (e) {
            console.log(e);
        }
    }
    useEffect(() => {
        getUserdata();
    }, []);


    return (
        <div>
            <div className="for w-100">
                <div className="container-fluid">
                    <Navbar />
                    <React.Fragment>
                        <div className="accordion" id="accordionPanelsStayOpenExample">
                            <div className="accordion-item">
                                <h2 className="accordion-header" id="panelsStayOpen-headingOne">
                                    <button className="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target="#panelsStayOpen-collapseOne" aria-expanded="true" aria-controls="panelsStayOpen-collapseOne">
                                        Available Trainings
                                    </button>
                                </h2>
                                <div id="panelsStayOpen-collapseOne" className="accordion-collapse collapse show" aria-labelledby="panelsStayOpen-headingOne">
                                    <div className="accordion-body">
                                        <div className="form-group pull-right">
                                            <input id='search' type="text" className="search form-control" placeholder="What you looking for?"></input>
                                        </div>
                                        <span className="counter pull-right"></span>

                                        <table className="table table-hover table-bordered results" id="allTrainings">
                                            <thead>
                                                <tr>
                                                    {/* <th>S.No</th> */}
                                                    {/* <th >Domain Name</th> */}
                                                    <th >Training Name</th>
                                                    <th >Start Date </th>
                                                    <th >Start Time</th>
                                                    <th >End Date</th>
                                                    <th >End Time</th>
                                                    <th >Domain Name</th>
                                                    <th >Available Seats</th>
                                                    <th ></th>
                                                </tr>
                                                <tr className="warning no-result">
                                                    <td colspan="4"><i className="fa fa-warning"></i> No result</td>
                                                </tr>
                                            </thead>
                                            <tbody>
                                                <Users usersData={userdata} />
                                            </tbody>
                                        </table>
                                        </div>
                                        </div>
                                        </div>
                                    </div>

                                        <table class="table table-hover table-bordered results" id="allTrainings">
                                            <thead>
                                                <tr>
                                                    {/* <th>S.No</th> */}
                                                    {/* <th >Domain Name</th> */}
                                                    <th >Training Name</th>
                                                    <th >Domain Name</th>
                                                    <th >Start Date </th>
                                                    <th >Start Time</th>
                                                    <th >End Date</th>
                                                    <th >End Time</th>
                                                    
                                                    <th >Available Seats</th>
                                                    <th ></th>
                                                </tr>
                                                <tr className="warning no-result">
                                                    <td colspan="4"><i className="fa fa-warning"></i> No result</td>
                                                </tr>
                                            </thead>
                                            <tbody>
                                                <Users usersData={userdata} />
                                            </tbody>
                                        </table>
                                    </React.Fragment >
                                </div>
                            </div>
                        </div>
                        );
}

                        export default UserForm;
